import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class AboutPage extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            height: 200,
            width: 200,
            backgroundColor: "black",
            zIndex: 0,
          }}
        ></div>
        <div
          style={{
            maxWidth: 400,
            height: 200,
            width: "auto",
            backgroundColor: "rgb(255, 203, 105)",
            margin: 30,
            fontFamily: "Unna",
            fontSize: 70,
            fontWeight: "bold",
            display: "grid",
            alignContent: "center",
            justifyContent: "center",
            zIndex: 1,
          }}
        >
          <div style={{}}>
            <div style={{ alignContent: "center" }}>Vivan</div>
            <div style={{ alignContent: "center" }}>Marwaha</div>
          </div>
        </div>
      </div>
    );
  }
}

export default AboutPage;
